import axios from 'axios';

function SearchBar(props) {
    const DOC_URL = "http://localhost:3000/documents/?name="

    const searchFocDoc = () => {
        let docName = document.getElementById("header-search")
        axios.get(DOC_URL + docName)
        .then(res => {
            console.log(res)
            props.docs.forEach(doc => {
                if (String(doc.name).localCompare(docName)) { 
                    console.log("doc found!")
                }
            })
        })
        .catch((err) => {
            console.log(err);
        });
    }

    return (
        <form action="/" method="get" className="docs_header">
            <label htmlFor="header-search">
                <span className="placeholder">Search Documents</span>
            </label>
            <input
                type="text"
                id="header-search"
                placeholder="Search documents" 
            />
            <button type="button" onClick={searchFocDoc}>Search</button>
        </form>
    );
}

export default SearchBar;
